function buildKeyboard() {
    // this.buildKeyboard()
    this.removeAllMorphs();
    this.setExtent(pt(100, 20));
    var wtWid, bkWid, keyRect, key, octavePt, nWhite, nBlack;
    var nOctaves = 6;
    var margin1 = pt(8, 18), margin2 = pt(8, 4);
    wtWid = 8; bkWid = 5;
    this.keys = [];

    var bnds = new Rectangle(0, 0, 0, 0);
    for (var i=0; i<nOctaves+1; i++) {
        if (i < nOctaves) {nWhite = 7;  nBlack = 5;
        } else {nWhite = 1;  nBlack = 0; // Hich C
        }
        var octavePt = pt(7*wtWid*i, 0);
        for (var j=0; j<nWhite; j++) {
            keyRect = octavePt.addPt(margin1).addXY((j)*wtWid, 0).extent(pt(wtWid+1, 36));
            var noteNumber = i*12 + ([1, 3, 5, 6, 8, 10, 12][j]);
            this.keys[noteNumber] = this.addMorph(this.makeKey(keyRect, noteNumber, Color.white));
            bnds = bnds.union(keyRect);
        }
        for (var j=0; j<nBlack; j++) {
            keyRect = octavePt.addPt(margin1).addXY([6, 15, 29, 38, 47][j], 1).extent(pt(bkWid, 21));
            noteNumber = i*12 + ([2, 4, 7, 9, 11][j]);
            this.keys[noteNumber] = this.addMorph(this.makeKey(keyRect, noteNumber, Color.black));
        }
    }
    // New bounds encloses all keys plus margin
    this.setExtent(bnds.extent().addPt(margin2));
    this.setFill(Color.darkGray.darker());
    this.buildButtons();
 }

