function makeKey(keyRect, noteNumber, fill) {
    // this.reset();  // test
    var key = lively.morphic.Morph.makeRectangle(keyRect);
    key.disableGrabbing()
    key.setFill(fill);
    key.myFill = fill;
    key.noteNumber = noteNumber;
    key.addScript(function press(evt/*might be null*/) {
        this.owner.pianoKeyDown(evt, this); evt && evt.stop(); });
    key.addScript(function release(evt/*might be null*/) {
        this.owner.pianoKeyUp(evt, this); evt && evt.stop(); });
    return key;
}

