function playerProcessStep() {
    if (!this.audioHandle) this.createAudioHandle();
    if (!this.audioHandle || !Object.isFunction(this.audioHandle.executeCallback)) {
        console.warn('XAudioServer loaded but no execute callback. Is the audio system initialized?');
        return;
    }
    this.audioHandle.executeCallback();
}

