function checkForKeyPressAndRelease() {
    // check if a hand is still above those keys that were
    // active before, if not deactivate them
    var world = this.world();
    if (!world) return;
    var hand = world.firstHand();
    if (!hand.isPressed()) {
        if (this.keyDown) this.keyDown.release();  // Release the key that was down
        this.keyDown = null;
        return; };

    if (this.keyDown) {
        if (this.keyDown.innerBoundsContainsWorldPoint(hand.getPosition()))
            return;  // mouse still down in the same morph
        if (this.keyDown) this.keyDown.release(); };  // mouse has left the former keyDown
    this.keyDown = null;

    // now activate the key that might be pressed
    var pressedOnMorph = hand.morphUnderMe();
    if (this.submorphs.include(pressedOnMorph)) {
        this.keyDown = pressedOnMorph;
        pressedOnMorph.press(); }
}

