function clearSoundBuffer(sizeUsed) {
    // Note sizeUsed must be 2 * number of stereo samples
    var buffer = new Array(sizeUsed);
    for (var i=0; i<sizeUsed; i++) buffer[i] = 0;
    return buffer;
}

