function loadMidi(data) {
    var _this = this;
    if (typeof MidiFile == "undefined")
        return JSLoader.loadJs(Config.codeBase+"lib/jasmid/stream.js", function() {
            JSLoader.loadJs(Config.codeBase+"lib/jasmid/midifile.js", function() {
                _this.loadMidi(data);
            })
        });

    var midi = MidiFile(data),
        score = new lively.Sound.Score(),
        player = new lively.Sound.ScorePlayer();
    score.fromMidiFile(midi);
    player.setScore(score);
    player.setKeyboard(_this);
    player.openPianoRoll();
    player.play();
}

